import React from 'react';
import { 
  BarChart3, 
  TrendingUp, 
  Clock, 
  CheckCircle2, 
  AlertTriangle,
  Activity,
  Users,
  Zap
} from 'lucide-react';

const Dashboard = ({ stats, agentStats, recentActivity }) => {
  const metrics = [
    {
      title: 'Total Tasks',
      value: stats.total,
      change: '+12%',
      changeType: 'positive',
      icon: BarChart3,
      color: 'brand'
    },
    {
      title: 'Completed',
      value: stats.completed,
      change: '+8%',
      changeType: 'positive',
      icon: CheckCircle2,
      color: 'success'
    },
    {
      title: 'In Progress',
      value: stats.running,
      change: stats.running > 0 ? 'Active' : 'Idle',
      changeType: stats.running > 0 ? 'neutral' : 'neutral',
      icon: Clock,
      color: 'warning'
    },
    {
      title: 'Failed',
      value: stats.failed,
      change: stats.failed === 0 ? 'Excellent' : '-2%',
      changeType: stats.failed === 0 ? 'positive' : 'negative',
      icon: AlertTriangle,
      color: 'error'
    }
  ];

  const agentMetrics = [
    {
      title: 'Active Agents',
      value: `${agentStats.busy}/${agentStats.total}`,
      subtitle: 'Currently processing',
      icon: Activity,
      color: 'brand'
    },
    {
      title: 'Ready Agents',
      value: agentStats.ready,
      subtitle: 'Available for tasks',
      icon: Users,
      color: 'success'
    },
    {
      title: 'Total Completed',
      value: agentStats.totalCompleted,
      subtitle: 'All-time completions',
      icon: Zap,
      color: 'info'
    }
  ];

  const getChangeColor = (type) => {
    switch (type) {
      case 'positive':
        return 'text-success-600';
      case 'negative':
        return 'text-error-600';
      default:
        return 'text-neutral-500';
    }
  };

  const getIconColor = (color) => {
    const colors = {
      brand: 'text-brand-600 bg-brand-100',
      success: 'text-success-600 bg-success-100',
      warning: 'text-warning-600 bg-warning-100',
      error: 'text-error-600 bg-error-100',
      info: 'text-info-600 bg-info-100'
    };
    return colors[color] || 'text-neutral-600 bg-neutral-100';
  };

  return (
    <div className="space-y-8">
      {/* Main Metrics */}
      <div>
        <div className="flex items-center justify-between mb-6">
          <div>
            <h2 className="text-2xl font-bold text-neutral-900">Dashboard Overview</h2>
            <p className="text-neutral-600 mt-1">Monitor your AI agent orchestration performance</p>
          </div>
          <div className="flex items-center space-x-2 text-sm text-neutral-500">
            <div className="w-2 h-2 bg-success-500 rounded-full animate-pulse"></div>
            <span>Live data</span>
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {metrics.map((metric, index) => {
            const Icon = metric.icon;
            return (
              <div key={index} className="card p-6 hover:shadow-medium transition-all duration-200">
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-sm font-medium text-neutral-600 mb-1">{metric.title}</p>
                    <p className="text-3xl font-bold text-neutral-900">{metric.value}</p>
                    <p className={`text-sm font-medium mt-1 ${getChangeColor(metric.changeType)}`}>
                      {metric.change}
                    </p>
                  </div>
                  <div className={`p-3 rounded-xl ${getIconColor(metric.color)}`}>
                    <Icon className="w-6 h-6" />
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>

      {/* Agent Performance */}
      <div>
        <h3 className="text-xl font-semibold text-neutral-900 mb-4">Agent Performance</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {agentMetrics.map((metric, index) => {
            const Icon = metric.icon;
            return (
              <div key={index} className="card p-6">
                <div className="flex items-center space-x-4">
                  <div className={`p-3 rounded-xl ${getIconColor(metric.color)}`}>
                    <Icon className="w-6 h-6" />
                  </div>
                  <div>
                    <p className="text-2xl font-bold text-neutral-900">{metric.value}</p>
                    <p className="text-sm font-medium text-neutral-600">{metric.title}</p>
                    <p className="text-xs text-neutral-500">{metric.subtitle}</p>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>

      {/* System Health */}
      <div className="card p-6">
        <h3 className="text-lg font-semibold text-neutral-900 mb-4">System Health</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <div className="space-y-2">
            <div className="flex justify-between items-center">
              <span className="text-sm font-medium text-neutral-600">CPU Usage</span>
              <span className="text-sm font-semibold text-neutral-900">23%</span>
            </div>
            <div className="progress-bar h-2">
              <div className="progress-fill" style={{ width: '23%' }}></div>
            </div>
          </div>

          <div className="space-y-2">
            <div className="flex justify-between items-center">
              <span className="text-sm font-medium text-neutral-600">Memory Usage</span>
              <span className="text-sm font-semibold text-neutral-900">67%</span>
            </div>
            <div className="progress-bar h-2">
              <div className="progress-fill" style={{ width: '67%' }}></div>
            </div>
          </div>

          <div className="space-y-2">
            <div className="flex justify-between items-center">
              <span className="text-sm font-medium text-neutral-600">Agent Efficiency</span>
              <span className="text-sm font-semibold text-neutral-900">94%</span>
            </div>
            <div className="progress-bar h-2">
              <div className="progress-fill" style={{ width: '94%' }}></div>
            </div>
          </div>
        </div>
      </div>

      {/* Recent Activity */}
      {recentActivity && recentActivity.length > 0 && (
        <div className="card p-6">
          <h3 className="text-lg font-semibold text-neutral-900 mb-4">Recent Activity</h3>
          <div className="space-y-3">
            {recentActivity.slice(0, 5).map((activity, index) => (
              <div key={index} className="flex items-center space-x-3 p-3 rounded-lg bg-neutral-50">
                <div className="w-2 h-2 bg-brand-500 rounded-full"></div>
                <div className="flex-1">
                  <p className="text-sm font-medium text-neutral-900">{activity.message}</p>
                  <p className="text-xs text-neutral-500">{activity.timestamp}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
